import { SET_GRID_SIZE } from "../actions/types";

const initialState = {
	dimensions: {
		width: 250,
		height: 250
	}
};

export default function(state = initialState, action) {
	switch (action.type) {
		case SET_GRID_SIZE:
			console.log(action);
			return {
				...state,
				dimensions: action.payload
			};
		default:
			return state;
	}
}
